        <footer class="page-footer">
            <nav id="bot-nav">
            <div class="button-group-container">
                <a href="">task_alt</a>
                <a href="">forum</a>
                <a href="">home</a>
                <a href="">leaderboard</a>
                <a href="">person</a>
            </div>
            </nav>
        </footer>
    )

}
